import React from "react";
import {Link} from "react-scroll";

class Navbar extends components {
state = {};
render(){
  return(
<div className="Navbar">
<ul>
<Link
    activeClass="active"
    to="Home"
    spy={true}
    smooth={true}
    offset={-70}
    duration= {500}
>Home</Link>
<li>About</li>
<li>service</li>
<li>contact</li>

</ul>
</div>
);
}
}
export default Navbar;
